import { useDispatch } from "react-redux"
import { setCollection } from "../../store/slices/slice"

function MarketsButton(){
    const dispatch=useDispatch()
    return(
        <div className="flex w-full">
            <button className="bg-sky-500 hover:bg-sky-200  flex-grow rounded-tl-xl rounded-bl-xl text-xs  sm:text-base" onClick={()=>dispatch(setCollection('stocks'))}>Stocks</button>
            <button className="bg-sky-500 hover:bg-sky-200  flex-grow text-xs  sm:text-base" onClick={()=>dispatch(setCollection('commodities'))}>Commodities</button>
            <button className="bg-sky-500 hover:bg-sky-200  flex-grow rounded-tr-xl rounded-br-xl text-xs  sm:text-base" onClick={()=>dispatch(setCollection('cryptocurrencies'))}>Crypto</button>
        </div>
    )
}

export default MarketsButton
